package db.domain;import java.util.Arrays;public class UserMarketImpl implements UserMarket {	@Key	private int tradId;	private String uname;	private int fighterId;	private int typeId;	private int tradNub;	private int tradType;	private int time;	public UserMarketImpl() {	}	public UserMarketImpl(UserMarket c) {		this.tradId = c.getTradId();		this.uname = c.getUname();		this.fighterId = c.getFighterId();		this.typeId = c.getTypeId();		this.tradNub = c.getTradNub();		this.tradType = c.getTradType();		this.time = c.getTime();	}	@Override	public String tableName() {		return "user_market";	}	public void setTradId(int tradId) {		this.tradId = tradId;	}	public int getTradId() {		return this.tradId;	}public void addTradId(int tradId) {		this.tradId += tradId;}	public void setUname(String uname) {		this.uname = uname;	}	public String getUname() {		return this.uname;	}public void addUname(String uname) {		this.uname += uname;}	public void setFighterId(int fighterId) {		this.fighterId = fighterId;	}	public int getFighterId() {		return this.fighterId;	}public void addFighterId(int fighterId) {		this.fighterId += fighterId;}	public void setTypeId(int typeId) {		this.typeId = typeId;	}	public int getTypeId() {		return this.typeId;	}public void addTypeId(int typeId) {		this.typeId += typeId;}	public void setTradNub(int tradNub) {		this.tradNub = tradNub;	}	public int getTradNub() {		return this.tradNub;	}public void addTradNub(int tradNub) {		this.tradNub += tradNub;}	public void setTradType(int tradType) {		this.tradType = tradType;	}	public int getTradType() {		return this.tradType;	}public void addTradType(int tradType) {		this.tradType += tradType;}	public void setTime(int time) {		this.time = time;	}	public int getTime() {		return this.time;	}public void addTime(int time) {		this.time += time;}}